            getMonthNineStar:function(){
              var start = 2;
              var yearZhi = this.getYearZhi();
              if (''.indexOf(yearZhi)>-1) {
                start = 8;
              } else if (''.indexOf(yearZhi)>-1) {
                start = 5;
              }
              // -2
              var monthIndex = this._p.monthZhiIndex-2;
              if(monthIndex<0){
                monthIndex += 12;
              }
              var index = start-monthIndex-1;
              while(index<0){
                index += 9;
              }
              return NineStar.fromIndex(index);
            },
            getDayNineStar:function(){
              //
              var solarYmd = this._p.solar.toYmd();
              var yuShui = this._p.jieQi[''].toYmd();
              var guYu = this._p.jieQi[''].toYmd();
              var xiaZhi = this._p.jieQi[''].toYmd();
              var chuShu = this._p.jieQi[''].toYmd();
              var shuangJiang = this._p.jieQi[''].toYmd();

              var start = 6;
              var asc = false;
              if(solarYmd>=this._p.jieQi[''].toYmd()&& solarYmd<yuShui){
                asc = true;
                start = 1;
              } else if(solarYmd>=yuShui && solarYmd<guYu){
                asc = true;
                start = 7;
              } else if(solarYmd>=guYu && solarYmd<xiaZhi){
                asc = true;
                start = 4;
              } else if(solarYmd>=xiaZhi && solarYmd<chuShu){
                start = 9;
              } else if(solarYmd>=chuShu && solarYmd<shuangJiang){
                start = 3;
              }
              var ganZhiIndex = LunarUtil.getJiaZiIndex(this.getDayInGanZhi())%9;
              var index = asc?start+ganZhiIndex-1:start-ganZhiIndex-1;
              if(index>8){
                index -= 9;
              }
              if(index<0){
                index += 9;
              }
              return NineStar.fromIndex(index);
            },
            getTimeNineStar:function(){
              //
              var solarYmd = this._p.solar.toYmd();
              var asc = false;
              if(solarYmd>=this._p.jieQi[''].toYmd() && solarYmd<this._p.jieQi[''].toYmd()){
                asc = true;
              }
              var start = asc?7:3;
              var dayZhi = this.getDayZhi();
              if (''.indexOf(dayZhi)>-1) {
                start = asc?1:9;
              } else if (''.indexOf(dayZhi)>-1) {
                start = asc?4:6;
              }
              var index = asc?start+this._p.timeZhiIndex-1:start-this._p.timeZhiIndex-1;
              if(index>8){
                index -= 9;
              }
              if(index<0){
                index += 9;
              }
              return NineStar.fromIndex(index);
            },
